import React, { Component } from "react";

class HomePage extends Component {
    state = {
        myImg: ""
    }

    UNSAFE_componentWillMount() {
        snaplist().then((value) => {
            this.setState({myImg: value.data});
        });
    }

    render() {
        const { myImg } = this.state;
        return(
            <div style={{border: "2px solid black"}}>
                <h2>Hello</h2>
                {myImg !== "" && 
                    <div style={{display: "block", width: "320px", height: "320px", overflow: "hidden"}}>
                        <img src={myImg} alt="snaps" style={{margin: "auto", display: "block"}}/>
                    </div>
                }
            </div>
        )
    }
}

const snaplist = () => {
    return fetch("http://localhost:8080/snaplist").then((response) => {
        return response.json();
    });
}

export default HomePage;
